import React, {useState} from "react";

function App() {

  function List(props){
    return (
      <li>
        {props.item}
      </li>
    )
  }


  return (
    <div className="container">
      <div className="heading">
        <h1>To-Do List</h1>
      </div>
      <div className="form">
        <input type="text" />
        <button>
          <span>Add</span>
        </button>
      </div>
      <div>
        <ul>
         <List item="{newItem}"/> 
        </ul>
      </div>
    </div>
  );
}

export default App;
